import CustomerView from "@/components/danışan/views/CustomerView.vue";
import SettingsView from "@/components/settings/views/SettingsView.vue";

export const componentList = (app) => {
    app.component("customer-view", CustomerView);
    app.component("settings-view", SettingsView);
}
